import { useEffect, useState } from 'react';
import axios from 'axios';

import './App.css';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    const getTrades = async () => {
      const res = await axios.get('trades');
      const { trades } = res.data;
      setData(trades);
    };

    getTrades();
  });

  return (
    <div className='App'>
      <h1>Trades</h1>
    </div>
  );
}

export default App;
